                    https://prev.dailyherald.com/story/?id=262230robot
                </div>
            </div>

            <div className="section-right">
              <img src={photo} className="about-me-photo" alt="xiuli_its_me" />
              <img src={robotics1} className="about-me-photo" alt="xiuli_its_me" />
              <img src={robotics2} className="about-me-photo" alt="xiuli_its_me" />
            </div>
        </div>);
}
export default About;
